import { UserCircleIcon } from "@heroicons/react/outline"
import { IdentificationIcon } from "@heroicons/react/outline";
import { InformationCircleIcon } from "@heroicons/react/outline";
import { ShieldCheckIcon } from "@heroicons/react/outline";
import { Link } from "react-router-dom"
import AccountFooter from "../AccountFooter"

import './style.css';

export default function AccountSideBar() {
  return (
    <div className="account-sidebar"> 
      <div className="sidebar-item"><UserCircleIcon className="sidebar-icon"/><Link to="myaccount/">Home</Link></div>
      <div className="sidebar-item"><IdentificationIcon className="sidebar-icon"/><Link to="myaccount/personalinfo/">Personal info</Link></div>
      <div className="sidebar-item"><ShieldCheckIcon className="sidebar-icon"/><Link to="myaccount/data-and-personalization">Data & Privacy</Link></div>
      <div className="sidebar-item"><InformationCircleIcon className="sidebar-icon"/><a href="https://www.google.com/account/about/" target="_blank">Home</a></div>
    <AccountFooter />
    </div>
  )
}
